.\\r\\n\\r\\nNamun di sisi lainnya, ada seorang warga yang merekam aksi yang dilakukan polisi tersebut kepada Floyd. Di mana polisi menginjak leher Floyd dengan lututnya dengan durasi sekitar 8 menit.\\r\\n\\r\\nDi dalam video itu, tampak polisi menahannya di tanah dan seorang polisi lainnya menekan lututnya ke leher Floyd.\\r\\n\\r\\n'Lututmu di leherku, aku tidak bisa bernapas, mama... mama...\\\" pinta Floyd.\\r\\n\\r\\nTak lama, Floyd diam dan tak bergerak. Dia bahkan tak bergerak ketika petugas memintanya untuk bangun dan masuk ke dalam mobil. Dia kemudian dibawa ke rumah sakit dan dinyatakan meninggal dunia.\\r\\n\\r\\nKejadian ini memancing kemarahan publik AS atas sikap arogansi polisi hingga menyebabkan kematian terhadap Floyd.\\r\\n\\r\\nDemonstran bentrok dengan polisi, dan menjarah toko-toko dan membakar ketika seorang pria ditembak mati polisi pada malam kedua protes di kota Minneapolis, Rabu (27\/5\/2020).\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/Dzyuu7Splfg\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBQ1pgjcCgtKf0cY7ewiX9C1gzoRw\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/Dzyuu7Splfg\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLB8WJkZrLX-n-5JX3FKkXjw4ECxuw\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/Dzyuu7Splfg\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLBX6ASH9zCiKcE_oGMkRvxfa7ZmXA\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/Dzyuu7Splfg\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLBMM1WKdrXD9M1VgLPgMBeVt35cEA\",\"width\":336,\"height\":188},{\"url\":\"https:\/\/i.ytimg.com\/vi\/Dzyuu7Splfg\/maxresdefault.jpg\",\"width\":1920,\"height\":1080}]},\"averageRating\":4.6896124,\"allowRatings\":true,\"viewCount\":\"2446385\",\"author\":\"KOMPASTV\", M4S4Q6CS4JsrCN0skJt8KBHA\"}},\"microformat\":{\"playerMicroformatRenderer\":{\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/Dzyuu7Splfg\/maxresdefault.jpg\",\"width\":1280,\"height\":720}]},\"embed\":{\"iframeUrl\":\"https:\/\/www.youtube.com\/embed\/Dzyuu7Splfg\",\"flashUrl\":\"http:\/\/www.youtube.com\/v\/Dzyuu7Splfg?version=3\\u0026autohide=1\",\"width\":1280,\"height\":720,\"flashSecureUrl\":\"https:\/\/www.youtube.com\/v\/Dzyuu7Splfg?version=3\\u0026autohide=1\"},\"title\":{\"simpleText\":\"Detik-Detik Penangkapan George Floyd Hingga Meninggal yang Bikin Publik AS Marah\"},\"description\":{\"simpleText\":\"MINNEAPOLIS, KOMPAS.TV - Kamera CCTV milik sebuah restoran di Minneapolis, Amerika Serikat merekam detik-detik penangkapan seorang pria bernama George Floyd oleh polisi, sebelum akhirnya pria tersebut meninggal dunia karena lehernya diinjak.\\r\\n\\r\\nRekaman kamera cctv tersebut memperlihatkan polisi mendekati mobil yang ditumpangi Floyd bersama dua orang lainnya. Seorang polisi kemudian menangkap Floyd hingga kemudian Floyd terduduk di dekat kamera CCTV yang merekamnya.\\r\\n\\r\\nPolisi tersebut kemudian membawa Floyd ke seberang jalan, yang kemudian insiden mematikan terjadi. Dari kejauhan terlihat, Floyd terjatuh ke aspal, namun kemudian rekaman video dari CCTV tersebut terhalang oleh mobil polisi.\\r\\n\\r\\nNamun di sisi lainnya, ada seorang warga yang merekam aksi yang dilakukan polisi tersebut kepada Floyd. Di mana polisi menginjak leher Floyd dengan lututnya dengan durasi sekitar 8 menit.\\r\\n\\r\\nDi dalam video itu, tampak polisi menahannya di tanah dan seorang polisi lainnya menekan lututnya ke leher Floyd.\\r\\n\\r\\n'Lututmu di leherku, aku tidak bisa bernapas, mama... mama...\\\" pinta Floyd.\\r\\n\\r\\nTak lama, Floyd diam dan tak bergerak. Dia bahkan tak bergerak ketika petugas memintanya untuk bangun dan masuk ke dalam mobil. Dia kemudian dibawa ke rumah sakit dan dinyatakan meninggal dunia.\\r\\n\\r\\nKejadian ini memancing kemarahan publik AS atas sikap arogansi polisi hingga menyebabkan kematian terhadap Floyd.\\r\\n\\r\\nDemonstran bentrok dengan polisi, dan menjarah toko-toko dan membakar ketika seorang pria ditembak mati polisi pada malam kedua protes di kota Minneapolis, Rabu (27\/5\/2020).\"},\"lengthSeconds\":\"60\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/KompasTVNews\",\"externalChannelId\":\"UC5BMIWZe9isJXLZZWPWvBlg\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"KM\",\"KN\",\"KP\",\"KR\",\"KW\",\"KY\",\"KZ\",\"LA\",\"LB\",\"LC\",\"LI\",\"LK\",\"LR\",\"LS\",\"LT\",\"LU\",\"LV\",\"LY\",\"MA\",\"MC\",\"MD\",\"ME\",\"MF\",\"MG\",\"MH\",\"MK\",\"ML\",\"MM\",\"MN\",\"MO\",\"MP\",\"MQ\",\"MR\",\"MS\",\"MT\",\"MU\",\"MV\",\"MW\",\"MX\",\"MY\",\"MZ\",\"NA\",\"NC\",\"NE\",\"NF\",\"NG\",\"NI\",\"NL\",\"NO\",\"NP\",\"NR\",\"NU\",\"NZ\",\"OM\",\"PA\",\"PE\",\"PF\",\"PG\",\"PH\",\"PK\",\"PL\",\"PM\",\"PN\",\"PR\",\"PS\",\"PT\",\"PW\",\"PY\",\"QA\",\"RE\",\"RO\",\"RS\",\"RU\",\"RW\",\"SA\",\"SB\",\"SC\",\"SD\",\"SE\",\"SG\",\"SH\",\"SI\",\"SJ\",\"SK\",\"SL\",\"SM\",\"SN\",\"SO\",\"SR\",\"SS\",\"ST\",\"SV\",\"SX\",\"SY\",\"SZ\",\"TC\",\"TD\",\"TF\",\"TG\", ngga kemudian Floyd terduduk di dekat kamera CCTV yang merekamnya.\r\n\r\nPolisi tersebut kemudian membawa Floyd ke seberang jalan, yang kemudian insiden mematikan terjadi. Dari kejauhan terlihat, Floyd terjatuh ke aspal, namun kemudian rekaman video dari CCTV tersebut terhalang oleh mobil polisi.\r\n\r\nNamun di sisi lainnya, ada seorang warga yang merekam aksi yang dilakukan polisi tersebut kepada Floyd. Di mana polisi menginjak leher Floyd dengan lututnya dengan durasi sekitar 8 menit.\r\n\r\nDi dalam video itu, tampak polisi menahannya di tanah dan seorang polisi lainnya menekan lututnya ke leher Floyd.\r\n\r\n'Lututmu di leherku, aku tidak bisa bernapas, mama... mama...\" pinta Floyd.\r\n\r\nTak lama, Floyd diam dan tak bergerak. Dia bahkan tak bergerak ketika petugas memintanya untuk bangun dan masuk ke dalam mobil. Dia kemudian dibawa ke rumah sakit dan dinyatakan meninggal dunia.\r\n\r\nKejadian ini memancing kemarahan publik AS atas sikap arogansi polisi hingga menyebabkan kematian terhadap Floyd.\r\n\r\nDemonstran bentrok dengan polisi, dan menjarah toko-toko dan membakar ketika seorang pria ditembak mati polisi pada malam kedua protes di kota Minneapolis, Rabu (27/5/2020).","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/Dzyuu7Splfg/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBQ1pgjcCgtKf0cY7ewiX9C1gzoRw","width":168,"height":94},{"url":"https://i.ytimg.com/vi/Dzyuu7Splfg/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLB8WJkZrLX-n-5JX3FKkXjw4ECxuw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/Dzyuu7Splfg/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLBX6ASH9zCiKcE_oGMkRvxfa7ZmXA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/Dzyuu7Splfg/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLBMM1WKdrXD9M1VgLPgMBeVt35cEA","width":336,"height":188} a, Floyd diam dan tak bergerak. Dia bahkan tak bergerak ketika petugas memintanya untuk bangun dan masuk ke dalam mobil. Dia kemudian dibawa ke rumah sakit dan dinyatakan meninggal dunia.\r\n\r\nKejadian ini memancing kemarahan publik AS atas sikap arogansi polisi hingga menyebabkan kematian terhadap Floyd.\r\n\r\nDemonstran bentrok dengan polisi, dan menjarah toko-toko dan membakar ketika seorang pria ditembak mati polisi pada malam kedua protes di kota Minneapolis, Rabu (27/5/2020)."},"lengthSeconds":"60","ownerProfileUrl":"http://www.youtube.com/user/KompasTVNews","externalChannelId":"UC5BMIWZe9isJXLZZWPWvBlg","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL","TM","TN","TO","TR","TT","TV","TW","TZ","UA","UG","UM","US","UY","UZ","VA","VC","VE","VG","VI","VN","VU","WF","WS","YE","YT","ZA","ZM","ZW"],"isUnlisted":false,"hasYpcMetadata":false,"viewCount":"2446385","category":"News \u0026 Pol
